import React from 'react';
import { List, Icon, FlexboxGrid } from 'rsuite';
import 'rsuite/dist/styles/rsuite-dark.css';

const data = [
    {
      title: '20170923-Hong Kong independent travel',
      icon: 'image',
      creator: 'Yvnonne',
      date: '2017.10.13 14:50',
      peak: 3223,
      peakRaise: 433,
      uv: 433,
      uvRaise: 33
    },
    {
      title: 'Celebration of the Mid-Autumn festival',
      icon: 'image',
      creator: 'Daibiao',
      date: '2017.10.13 14:50',
      peak: 3223,
      peakRaise: 238,
      uv: 238,
      uvRaise: 28
    },
    {
      title: 'Live to play basketball',
      icon: 'film',
      creator: 'Bidetoo',
      date: '2017.10.13 14:50',
      peak: 4238,
      peakRaise: -239,
      uv: 239,
      uvRaise: 29
    },
    {
      title: '2018 the legislature meeting broadcast live',
      icon: 'film',
      creator: 'Yvnonne',
      date: '2017.10.13 14:50',
      peak: 4238,
      peakRaise: 2321,
      uv: 921,
      uvRaise: 91
    },
    {
      title: 'Aiwanke paster',
      icon: 'image',
      creator: 'Tony',
      date: '2017.10.13 14:50',
      peak: 2321,
      peakRaise: 1321,
      uv: 321,
      uvRaise: 132
    }
  ];
  const styleCenter = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '60px'
  };

  const slimText = {
    fontSize: '0.666em',
    color: '#97969B',
    fontWeight: 'lighter',
    paddingBottom: 5
  };

  const titleStyle = {
    paddingBottom: 5,
    whiteSpace: 'nowrap',
    fontWeight: 500
  };

  const dataStyle = {
    fontSize: '1.2em',
    fontWeight: 500
  };

  class Tournaments extends React.Component {
    constructor() {
      super();
      this.renderRaise = this.renderRaise.bind(this);
    }

    renderRaise(number) {
      const isPositive = number > 0;
      const isNegative = number < 0;
      return (
        <span
          style={{
            paddingLeft: 15,
            color: isNegative ? 'red' : 'green'
          }}
        >
          <span>{isPositive ? '+' : null}</span>
          <span>{number}</span>
        </span>
      );
    }

    render() {
      return (
        <List hover>
          {data.map((item, index) => (
            <List.Item key={item['title']} index={index}>
              <FlexboxGrid>
                {/*icon*/}
                <FlexboxGrid.Item colspan={2} style={styleCenter}>
                  <Icon
                    icon={item['icon']}
                    style={{
                      color: 'darkgrey',
                      fontSize: '1.5em'
                    }}
                  />
                </FlexboxGrid.Item>
                {/*base info*/}
                <FlexboxGrid.Item
                  colspan={6}
                  style={{
                    ...styleCenter,
                    flexDirection: 'column',
                    alignItems: 'flex-start',
                    overflow: 'hidden'
                  }}
                >
                  <div style={titleStyle}>{item['title']}</div>
                  <div style={slimText}>
                    <div>
                      <Icon icon="user-circle-o" />
                      {' ' + item['creator']}
                    </div>
                    <div>{item['date']}</div>
                  </div>
                </FlexboxGrid.Item>
                {/*peak data*/}
                <FlexboxGrid.Item colspan={6} style={styleCenter}>
                  <div style={{ textAlign: 'right' }}>
                    <div style={slimText}>Top Value</div>
                    <div style={dataStyle}>{item['peak'].toLocaleString()}</div>
                  </div>
                  {this.renderRaise(item['peakRaise'])}
                </FlexboxGrid.Item>
                {/*uv data*/}
                <FlexboxGrid.Item colspan={6} style={styleCenter}>
                  <div style={{ textAlign: 'right' }}>
                    <div style={slimText}>UV</div>
                    <div style={dataStyle}>{item['uv'].toLocaleString()}</div>
                  </div>
                  {this.renderRaise(item['uvRaise'])}
                </FlexboxGrid.Item>
                {/*uv data*/}
                <FlexboxGrid.Item
                  colspan={4}
                  style={{
                    ...styleCenter
                  }}
                >
                  <a href="#">View</a>
                  <span style={{ padding: 5 }}>|</span>
                  <a href="#">Edit</a>
                </FlexboxGrid.Item>
              </FlexboxGrid>
            </List.Item>
          ))}
        </List>
      );
    }
  }

export default Tournaments
